import './App.css';
import React from 'react';
import Navbar from './components/Navbar';
import Home from './components/Home';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';


function App() {
  return (
    <div>
      <Router>
        <Navbar />
        <Routes>

        </Routes>
        <Route to = "/"><Home /></Route>

      </Router>

      <Home />
    </div>
  );
}

export default App;
